import React from "react";
import { Container } from "react-bootstrap";
import NavbarBg from "../components/NavbarBg";

const Payment = () => {
  return (
    <>
      <NavbarBg />

      <Container
        className="border border-0 rounded-1"
        style={{ backgroundColor: "white", marginTop: "66px" }}
      >
        <div className="d-flex justify-content-between">
          <img
            style={{ height: "68px", alignItems: "center" }}
            src={require("../images/Iconblk.png")}
            alt=""
          />
          <div>
            <h1>Booking</h1>
            <p>Saturday, 22 Juy 2020</p>
          </div>
        </div>

        <div>
          {/* Title && Country */}
          <div>
            <h1>6D/4N Fun Tassie Vacation</h1>
            <p>Australia</p>

            <p
              className="p3"
              style={{
                backgroundColor: "#EC7A7A",
                width: "120px",
                background: "linearGradient(180deg, #EC7A7A 0%, #EC7A7A 100%)",
                opacity: "0.1",
                bordeRadius: "2px",
                fontSize: "12px",
              }}
            >
              Waiting payment
            </p>
          </div>
          <div></div>
          <div></div>
        </div>
      </Container>
    </>
  );
};

export default Payment;
